        borderRadius : 10,
        backgroundColor : "lightblue"
      }}>
      </View> */}
      <Text>My Course</Text>
      <Button title="Go to work out!" onPress={() => {navigation.navigate("Play a Course")}} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
